import React, { Component } from "react";
import './scss/base/MusicMonitor.scss';
import Logo from "./logo/ejoya-logo.png";
import Singing from "./images/sidebar_image.png";
// import Sound from "./icons/sound_icon.svg";

class MusicMonitor extends Component {
  render() {
   
    return (
     
      <div className="music_monitor">
      
           <div className="sidebar_wrapper">
           <div className="logo_text">
           <img className="logo" src= {Logo} alt="logo"/>
           <p className="text">ejoya</p>
           </div>
          
           <div className="artist_release">
           <div>
           <img className="sidebar_image" src={Singing} alt="logo"/>
           <p className="artist_name">Artist Name</p>
         
           </div>
           </div>
            
           </div>

           <div className="main_page">
           
           <p className="music_header"> Music Monitor</p>
           <div className="search-catalogue">
             <p></p>
           </div>
           <div className="music_region">
           
            <p className="musiic">Music</p> <p>Regions</p>
            </div>

           </div>
          
     
      </div>
    
    );
  }
}


export default MusicMonitor;
